import React, { Component } from "react";
import { connect } from "react-redux";

export class ResutsTotal extends Component {
  render() {
    const { result } = this.props;
    return (
      <div>
        <div>
          <h5>Total Result : {result} </h5>
        </div>
      </div>
    );
  }
}

export default connect()(ResutsTotal);
